I'm trying to create a rust app that can read the contents of the clipboard aloud using the elevenlabs.io api. I've been looking at the documentation for the elevenlabs.io api and the `clipboard` crate, but I'm not sure how to put it all together.

Here's what I have so far:

```
use clipboard::ClipboardProvider;
use reqwest::Client;
use serde::Deserialize;
use std::error::Error;

#[derive(Deserialize)]
struct TextToSpeechResponse {
    audio: String,
}

async fn text_to_speech(client: &Client, text: &str) -> Result<TextToSpeechResponse, Box<dyn Error>> {
    let response = client
        .post("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&json!({
            "text": text,
            "voice_settings": {
                "stability": 0.5,
                "similarity_boost": 0.75,
            }
        }))
        .send()
        .await?
        .json()
        .await?;

    Ok(response)
}

#[tokio::main]
async fn main() -> Result<(), Box<dyn Error>> {
    let client = Client::new();
    let text = ClipboardProvider::new().get_contents().await?;

    let response = text_to_speech(&client, &text).await?;
    println!("{:?}", response);

    Ok(())
}
```

I'm not sure how to play the audio from the response, or if I even need to do that since the API returns a URL to the audio file. I'm also not sure how to handle errors from the API or the clipboard crate.

Any help would be appreciated!

## Answer (1)

You can use the `rodio` crate to play the audio. Here's an example of how you can modify your code to use it:

```
use clipboard::ClipboardProvider;
use reqwest::Client;
use serde::Deserialize;
use std::error::Error;
use rodio::{Decoder, Sink, Source};

#[derive(Deserialize)]
struct TextToSpeechResponse {
    audio: String,
}

async fn text_to_speech(client: &Client, text: &str) -> Result<TextToSpeechResponse, Box<dyn Error>> {
    let response = client
        .post("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&json!({
            "text": text,
            "voice_settings": {
                "stability": 0.5,
                "similarity_boost": 0.75,
            }
        }))
        .send()
        .await?
        .json()
        .await?;

    Ok(response)
}

#[tokio::main]
async fn main() -> Result<(), Box<dyn Error>> {
    let client = Client::new();
    let text = ClipboardProvider::new().get_contents().await?;

    let response = text_to_speech(&client, &text).await?;
    let audio_url = response.audio;

    // Download the audio file
    let audio_data = reqwest::get(&audio_url).await?.bytes().await?;

    // Decode the audio data
    let source = Decoder::new(audio_data.as_slice()).unwrap();

    // Play the audio
    let (_stream, stream_handle) = rodio::OutputStream::try_default().unwrap();
    stream_handle.play_raw(source.convert_samples());

    Ok(())
}
```

